import React, { useState } from 'react';

function Tab({ title, content }) {
    const [isOpen, setIsOpen] = useState(false);

    return (
        <div style={{ marginTop: '10px' }}>
            <button style={{ backgroundColor: 'white', color: 'black' }} onClick={() => setIsOpen(!isOpen)}>
                {title}
            </button>
            {isOpen && <div style={{ backgroundColor: 'white', color: 'black', padding: '10px' }}>{content}</div>}
        </div>
    );
}

export default Tab;
